import React, { Component } from "react";
class Dashboard extends Component {
  render() {
    let tableStyle = {};
    return (
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>Category</th>
            <th>Item name</th>
            <th>Amount</th>
            <th>Expense date</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>Grocery</td>
            <td>Bread</td>
            <td>40</td>
            <td>23 04 2019</td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Dashboard;
